import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import './App.css';

import MoviesList from './MoviesList'


const App = () => (
  <Router>
    <div className="App">
      <header className="App-header">
        <h1>MovieDB</h1>
      </header>
           <Switch>
             <Route path="/" component={MoviesList} />
           </Switch>
              <MoviesList  />

    </div>
    </Router>

)


export default App;
